import React from 'react';
import { useEffect } from 'react';

const ALLGun = () => {
    const [guns, setGuns] = useState([]);

    useEffect(()=>{
        fetch('https://raw.githubusercontent.com/mir-hussain/guns/main/data')
        .then(res => res.json())
        .then(data => console.log(data))
    }, [])

    return (
        <div>
            <h2>allld afdpf</h2>
        </div>
    );
};

export default ALLGun;
